import React from 'react';

function Goods() {
  return (
    <main style={{ width: '1500px' }}>
      <ul className="card-set list">
        <li className="card-set__item">
          <a href="#" className="card-set__link link">
            <div className="card">
              <img src="./img/goods.jpg" alt="" />
            </div>
          </a>
        </li>
        <li className="card-set__item">
          <a href="#" className="card-set__link link">
            <div className="card">
              <img src="./img/goods.jpg" alt="" />
            </div>
          </a>
        </li>
        {/* Add more list items for your goods */}
      </ul>
    </main>
  );
}

export default Goods;
